const dCenterX0 = calculator.HelperExpression({ latex: "d_{x0}" });
const dCenterX1 = calculator.HelperExpression({ latex: "d_{x1}" });
const dCenterX2 = calculator.HelperExpression({ latex: "d_{x2}" });
const dCenterX3 = calculator.HelperExpression({ latex: "d_{x3}" });
