const nCenterX0 = calculator.HelperExpression({ latex: "n_{x0}" });
const nCenterX1 = calculator.HelperExpression({ latex: "n_{x1}" });
const nCenterX2 = calculator.HelperExpression({ latex: "n_{x2}" });
const nCenterX3 = calculator.HelperExpression({ latex: "n_{x3}" });

const coinIDs = ["17", "16", "19"];
const coinInits = ["q", "n", "d"];
const coinPositions = [0, 0, 0];

const YList = [qCenterY, nCenterY, dCenterY];
const XList = [
  [qCenterX1, qCenterX2, qCenterX3, qCenterX0],
  [nCenterX1, nCenterX2, nCenterX3, nCenterX0],
  [dCenterX1, dCenterX2, dCenterX3, dCenterX0],
];

const setCoinCenter = (coin, circ) => {
  for (let i = coin + 1; i <= 2; i++) {
    if (coinPositions[i] === circ) {
      calculator.setExpression({
        id: coinIDs[coin],
        latex: `C_{${coinInits[coin]}}=\\left(${
          15 * coinPositions[coin]
        },0\\right)`,
      });
      return;
    }
  }

  calculator.setExpression({
    id: coinIDs[coin],
    latex: `C_{${coinInits[coin]}}=\\left(${circ * 15},0\\right)`,
  });
  coinPositions[coin] = circ;
};

const checkAndMoveCoin = (coin) => {
  if (YList[coin].numericValue === 1) {
    switch (true) {
      case XList[coin][3].numericValue === 1:
        calculator.setExpression({
          id: coinIDs[coin],
          latex: `C_{${coinInits[coin]}}=\\left(${
            15 * coinPositions[coin]
          },0\\right)`,
        });
        break;
      case XList[coin][0].numericValue === 1 && coinPositions[coin] !== 0:
        setCoinCenter(coin, 0);
        break;
      case XList[coin][1].numericValue === 1 && coinPositions[coin] !== 1:
        setCoinCenter(coin, 1);
        break;
      case XList[coin][2].numericValue === 1 && coinPositions[coin] !== 2:
        setCoinCenter(coin, 2);
        break;
    }
  } else {
    calculator.setExpression({
      id: coinIDs[coin],
      latex: `C_{${coinInits[coin]}}=\\left(${
        15 * coinPositions[coin]
      },0\\right)`,
    });
  }
};

document.addEventListener("mouseup", () => {
  checkAndMoveCoin(0);
  checkAndMoveCoin(1);
  checkAndMoveCoin(2);
});
